import styled from "@emotion/styled";
import Link from 'next/link'

const FooterWrap = styled.div`
  background: darkturquoise;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  text-align: center;
  align-items: center;
  box-sizing: border-box;
  width: 100%;
  padding: 4rem 2rem 4rem 2rem;
  margin: 3rem 0 0 0; 
  color: #fff;

    a{
      color: yellow;
    }
    p{
        margin: 0;
    }

    .tiny{
      font-size: 1.2rem;
      padding-top: .5rem;
    }
  `

export default function Footer(props){
    return(
        <FooterWrap>
            <footer>
            <img className="logo" loading="lazy" width="200px" src="/logo.svg"  alt="sup safari logo" />
            <p>Telefon: <strong>+47 41293362</strong></p>
            <p className="tiny">
            Made with<Link href="/blog"><a>Sanity.io</a></Link>, <Link href="/blog"><a>Netlify</a></Link>, og <Link href="/blog"><a>Sanity.io</a></Link>
         , Netlify and NextJS</p>
            </footer>
        </FooterWrap>

    )
}
